import React from 'react';
import './index.css';
import Home from './Pages/Home';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';


function App() {
  return (
    <div className="App">
    <h1>My name is Ade</h1>
    <Router>
      <Switch>
         <Route path="/" component={Home} exact />
      </Switch>
    </Router>

    </div>
  );
}

export default App;
